const convertedInputColor = computed(() => {
  return convertHexColor(inputs.color).toString().replace('#', '')
})

function convertHexColor(color) {
  switch (inputs.activeBlindnessType) {
    default:
      return 'NaN'
    case 'protanomaly':
      return blinder.protanomaly(color)
    case 'protanopia':
      return blinder.protanopia(color)
    case 'deuteranomaly':
      return blinder.deuteranomaly(color)
